import Navbar from './components/Navbar/Navbar';
import Home from './Home'; 
import Slide from './components/Slide/Slide';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


function App() {


  return (
    <Router>
    <>
      <Navbar /> 
      <div className="content">
        <Switch>
        <Route path="/">
          {/* <Home /> */}
        </Route>
        </Switch>
        <Slide />
      </div>
    </>
    </Router>
  );
}

export default App;
